const Navbar = () => {
  return (
    <body>
      <div>
        <div id="NavMenu">
          <Link href="/">
            <a id="logo">Jobaho</a>
          </Link>
          <Link href="/">
            <a id="navbarmenu">Home</a>
          </Link>
          <Link href="/">
            <a id="navbarmenu">About Us</a>
          </Link>
          <Link href="/">
            <a id="navbarmenu">Find a Job</a>
          </Link>
        </div>
      </div>
    </body>
  );
};

export default Navbar;
